import React from 'react';
import Head from 'next/head';
import Layout from '../Components/Layout'

const Home = () => {
    return(
        <Layout>
            <Head>
                <title>Home</title>
            </Head>

            <h1>Home</h1>
            <div>
                <img src="/img/eva.jpg" alt="Imagen de evangelion"/>
            </div>
        </Layout>
    )
}
export default Home;
